import React from 'react';
import logo from './logo.svg';
import './App.css';

//Common
import Title from './Components/Common/Title';
import MovieList from './Components/Common/MovieList';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Title>Lista de Peliculas</Title>
      </header>
        <MovieList>
          Hola
        </MovieList>
    </div>
  );
}

export default App;
